import React, { useState } from 'react';
import { Form, Button } from 'react-bootstrap';
import { useHistory } from 'react-router-dom';
import Modal from 'react-modal';
import './style.css';

function RideModal() {
	const [rideIsOpen, setRideIsOpen] = useState(false);
	return (
		<div className="Ride">
			<Button className="RideBtn" onClick={() => setRideIsOpen(true)}></Button>

			<div className="RideWrapper">
				<Modal isOpen={rideIsOpen} onRequestClose={() => setRideIsOpen(false)}>
					<h1 className="RideTitleMod">
						RIDE TRACKING BUTTON <br /> HAS BEEN ACTIVATED!!!
					</h1>
					<div className="Clooosebtn">
						<Button className="closeBtn" onClick={() => setRideIsOpen(false)}>
							X
						</Button>
					</div>

					<div className="etextRideWrap">
						<p className="RideEText">
							If you feel unsafe in the vehicle in which you are going, please provide us with<br />
							 more information in the STAY SAFE section (such as license plates, driver's name,<br />
							characteristics,here you are going, how you took that ride...) in this way we will<br />
							 have more info in case the button of SAVE ME is activated, if you think this is a <br />
							 kidnapping please press the SAVE ME button,anyway we are following closely your location!
						</p>
					</div>

					
				</Modal>
			</div>
		</div>
	);
}

export default RideModal;
